import styled from "styled-components";

const Button = styled.button`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  padding: 6px 6px 6px 8px;

  position: absolute;
  width: 382px;
  height: 48px;
  left: calc(50% - 382px / 2);
  top: calc(50% - 48px / 2 + 368px);

  border: none;
  text-transform: uppercase;
  background: #149f65;
  border-radius: 4px;
  /* text........ */
  font-family: "rubik";
  font-style: normal;
  font-weight: 500;
  font-size: 16px;
  line-height: 16px;
  /* identical to box height, or 100% */

  letter-spacing: 1.25px;
  text-transform: uppercase;

  color: #ffffff;
`;

export function BottomButton() {
  return <Button> hey</Button>;
}
